pragma solidity ^0.4.18;

import './Ownable.sol';

/* A contract that provides central logging capabilities for ease of upgrading. */
contract Logger is Ownable {

    // Addresses which are authorized to log messages
    mapping (address => bool) public loggers;

    // Modifiers
    modifier onlyLogger { if (!loggers[msg.sender]) revert(); _; }

    // Admin event
    event AuthorizedAddress(address newLogger);

    // Events
    event UserRelayCreated(address indexed relay, address relayOwner, address recipient);
    event MembershipActivated(address indexed relay, uint tier, uint timeStarted);
    event MembershipCancelled(address indexed relay, uint expirationDate);
    event MembershipTokensRetrieved(address indexed relay, uint timeRetrieved);
    event ExcessTokensRetrieved(address indexed relay, uint amount);

    function authorize(address _logger) public onlyOwner {
        if (!loggers[_logger]) {
            loggers[_logger] = true;
            AuthorizedAddress(_logger);
        }
    }

    function logUserRelayCreated(address _relay, address _owner, address _recipient) public onlyLogger {
        UserRelayCreated(_relay, _owner, _recipient);
    }

    function logMembershipActivated(address relay, uint tier, uint timeStarted) public onlyLogger {
        MembershipActivated(relay, tier, timeStarted);
    }

    function logMembershipCancelled(address relay, uint expirationDate) public onlyLogger {
        MembershipCancelled(relay, expirationDate);
    }

    function logMembershipTokensRetrieved(address relay, uint timeRetrieved) public onlyLogger {
        MembershipTokensRetrieved(relay, timeRetrieved);
    }

    function logExcessTokensRetrieved(address relay, uint amount) public onlyLogger {
        ExcessTokensRetrieved(relay, amount);
    }
}
